import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./components/common/header/Header";
import Footer from "./components/common/footer/Footer";
import About from "./components/about/About";
import Team from "./components/team/Team";
import Pricing from "./components/pricing/Pricing";
import Blog from "./components/blog/Blog";
import Contact from "./components/contact/Contact";
import Home from "./components/home/Home";
import Login from "./components/login/Login";  // Login page
import SignupPage from "./components/signup/SignupPage";  // Your Signup Page

function App() {
  return (
    <Router>
      <Routes>
        {/* Login page without Header and Footer */}
        <Route path="/login" element={<Login />} />

        {/* Other routes with Header and Footer */}
        <Route path="/" element={<LayoutWithHeaderFooter />}>
        </Route>
      </Routes>
    </Router>
  );
}

// Layout that includes Header and Footer for all other routes
function LayoutWithHeaderFooter() {
  return (
    <>
      <Header />
      <Outlet /> {/* Renders child route components */}
      <Footer />
    </>
  );
}

export default App;
